	let index = images.findIndex((image) => image.id === imageRef);
	let image = images[{ index }];

	console.log(index);

	return (
		<>
			<img src={image.sizes.medium} />
			<div onClick={props.onClick}>exit</div>
		</>
	);
};

export default Gallery;
